					var currentVal = $('#'+data.id).find(':selected').val();
					console.log('current value is ' + currentVal);
					var option_exists = false;
					
					$('#'+data.id).empty();
					
					var type = data.sa2.arr[0][0];
					var pos = data.sa2.arr[0][1];
					var match = data.sa2.arr[0][2];
					
					if(type == 'matching'){																
						if(pos == 'firstcolumn'){  /* look up for match in first column */
							$.each(data.sa1.arr, function(index, items) {			
								if(items[0] == data.s1){
									$.each(items.slice(1),function(subindex, subitem){
										if(subitem == '') return;
										if(currentVal == subitem) option_exists = true;
										$('#'+data.id).append( $('<option></option>').attr('data-value','s:'+subitem).html(subitem));//.attr('selected', subindex == 0) )
										console.log('added ');
									});
								}
							});									
						}else { /* look up for match in first row */
							$.each(data.sa1.arr[0], function(index, item){ 
								if(item == data.s1) { 
									$.each(data.sa1.arr.slice(1), function(subindex, subitem){ 											
										if(subitem[index] == '') return;
                                        if(currentVal == subitem[index]) option_exists = true;
										$('#'+data.id).append( $('<option></option>').attr('data-value','s:'+subitem[index]).html(subitem[index]));//.attr('selected', subindex == 0))
										console.log('added ');												
									});
								}
							});								
						}
					}else{ /* fixed row or column */
						$.each(data.sa1.arr, function(index, item) {	
						   $.each(item, function (subindex, subitem){
								if(subitem == '') return;
                                if(currentVal == subitem) option_exists = true;
								$('#'+data.id).append( $('<option></option>').attr('data-value','s:'+subitem).html(subitem));//.attr('selected', index == 0 && subindex == 0) )
								console.log('added ');
							});
						});
					}
				    console.log('option exists: ' + option_exists);
					if(option_exists) $('#'+data.id).val(currentVal); else  $('#'+data.id).find('option:first-child').attr('selected', 'selected');
